subsequence_1 = 'abcdab'
subsequence_2 = 'bdcaba'



def longest_common_subsequence(s_1, s_2):
  c = [[0 for _ in range(len(s_2) + 1)] for _ in range(len(s_1) + 1)]

  for i in range(len(s_1)):
    for j in range(len(s_2)):
      if s_1[i] == s_2[j]:
        c[i+1][j+1] = c[i][j] + 1
      else:
        c[i+1][j+1] = max(c[i][j+1], c[i+1][j])
  print(c[-1][-1])


n = 12
chars = [
  (
    '',
    ''
  ),
]

for sequences in chars:
  longest_common_subsequence(sequences[0], sequences[1])